import React, { Component } from 'react';
import './App.css';
import './config.js';

//import components
import Nav from './Components/Nav';
import Search from './Components/Search';
import Gallery from './Components/Gallery';
import NoResults from './Components/NoResults';

export default class App extends React.Component {
  state = {
    pictures: []
  };

  componentDidMount() {
    fetch("https://www.flickr.com/services/rest/?method=flickr.photos.search&api_key=adf8e835e70c5cce9208376d343d7ab8&tags=dogs&format=json&nojsoncallback=1&auth_token=72157713322643926-d0459381b0b88789&api_sig=1c359483fa6e011ffa7597d2b5cf7164")
    .then(response => response.json())
    .then(responseData => {
      this.setState({ pictures: responseData });
    })
  }

  render() {
    return (
      <div className="container">
        <Search />
        <Nav />
        <Gallery />
        <NoResults /> 
      </div>
    )
  }
};
